import math

def largest_fraction(n, d):
    num = 1
    den = 1
    q = 10000
    while q >= 2:
        p = (n * q - 1) // d
        if p * den >= q * num:
            num = p
            den = q
        q -= 1
    g = math.gcd(num, den)
    return (num // g, den // g)

